import React from 'react';
import './Collections.css';

const collectionProducts = [
  {
    id: 1,
    name: 'Elegant Perfume',
    price: 49.99,
    image: '/images/elegant-perfume.jpg',
  },
  {
    id: 2,
    name: 'Fresh Citrus Perfume',
    price: 39.99,
    image: '/images/fresh-citrus-perfume.jpg',
  },
  {
    id: 3,
    name: 'Floral Essence',
    price: 44.99,
    image: '/images/floral-essence.jpg',
  },
  {
    id: 4,
    name: 'Oriental Spice',
    price: 59.99,
    image: '/images/oriental-spice.jpg',
  },
];

const Collections = () => {
  return (
    <div className="collections-section">
      <h2>More Collections</h2>
      <div className="collections">
        {collectionProducts.map((product) => (
          <div key={product.id} className="collection-product-card">
            <img src={product.image} alt={product.name} className="collection-product-image" />
            <h3 className="collection-product-name">{product.name}</h3>
            <p className="collection-product-price">${product.price.toFixed(2)}</p>
            <button className="view-collection-product-btn">View Product</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Collections;
